import React from 'react';
import { Link } from 'react-router-dom';
function Navbar() {
  return (
    <nav className="bg-green-600 px-4 py-3 fixed top-0 w-full shadow-md z-10">
      <div className="container mx-auto flex justify-between items-center">
        <div className="text-white font-bold text-xl"><a href="/">Krishi Bazaar</a></div>
        <ul className="flex space-x-10">
          <li><a href="/" className="text-white hover:text-green-200 transition hover:bg-green-300">Home</a></li>
          <li><a href="/about" className="text-white hover:text-green-200 transition hover:bg-green-300">About</a></li>
          <li><a href="/partnerwithus" className="text-white hover:text-green-200 transition  hover:bg-green-300">Patner with us</a></li>
          <li><a href="/shop" className="text-white hover:text-green-200 transition ">Shop</a></li>
          <li><Link to="/signup" className="text-white hover:text-green-200 transition">Signup</Link></li>
        </ul>
      </div>
    </nav>
  );
}

export default Navbar;
